import React from "react";
import Navbar from "./Navbar";
import "./Farm.css";

function Farm(props) {
  return (
    <div>
      <div className="farmBox">
        <button
          className="accordion-btn"
          onClick={() => {
            props.toggleFunc(props.nameid);
          }}
        >
          {props.nameid} - <span># Of Fields: {props.fields.length}</span>
        </button>
        <div className={props.open ? `show` : `accordionContent`}>
          {props.fields.map((field) => (
            <ul>
              <br />
              <li>{field}</li>
            </ul>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Farm;
